import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';


const NavBar = (
  <nav>
    <ul>
      <li>HOME</li>
      <li>CONTACT</li>
      <li>ABOUT US</li>
    </ul>
  </nav>
)
const WholePage = <div>
  {NavBar}
  <h2>hello world</h2>

</div> 
const text = <h1>hello world</h1>
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(


  WholePage


);
